import React, { useState } from 'react';
import AppBar from '@mui/material/AppBar';
import Button from '@mui/material/Button';
import LocalGroceryStoreIcon from '@mui/icons-material/LocalGroceryStore';
import LogoutIcon from '@mui/icons-material/Logout';
import CssBaseline from '@mui/material/CssBaseline';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import { Link as RouterLink, useNavigate } from 'react-router-dom';
import Card from '@mui/material/Card';
import { Box, CardContent, CardMedia, Drawer, IconButton, List, ListItem, ListItemIcon, ListItemText, Paper } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import VideoLibraryIcon from '@mui/icons-material/VideoLibrary';
import './homeStyle.css'
import httpService from '../../services/httpService'

const Home = () => {
    const navigate = useNavigate()
    const [isDrawerOpen, setIsDrawerOpen] = useState(false);

    const toggleDrawer = (open) => (event) => {
        if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
        return;
        }
        setIsDrawerOpen(open);
    };

    const handleSignOut = () => {
        localStorage.removeItem("token")
        navigate('/')
    }

    const cardsData = [
        {
          title: 'Surprise Suitor',
          image: 'https://media.fstatic.com/un-0RsK54_7_bab5Q8ELukivy2Q=/322x478/smart/filters:format(webp)/media/movies/covers/2022/02/FK9jOgqaQAAaBDc.jpg',
          alt: 'Imagem do Card'
        },
    ];

    const list = (
        <Box
            sx={{ width: 250, bgcolor: "primary.main", minHeight: '100vh' }}
            onClick={toggleDrawer(false)}
            onKeyDown={toggleDrawer(false)}   
        >
            <List >
                <ListItem>
                    <ListItemIcon>
                        <AccountCircleIcon sx={{color: 'white'}} />
                    </ListItemIcon>
                    <ListItemText primary="Conta" sx={{color: 'white'}} />
                </ListItem>
                <ListItem>
                    <Button component={RouterLink} to="/library">
                        <ListItemIcon className='item_icon'>
                            <VideoLibraryIcon sx={{color: 'white'}}/>
                        </ListItemIcon>
                        <ListItemText primary="Biblioteca" className='text_menu'/>
                    </Button>
                </ListItem>
                <ListItem>
                    <Button onClick={handleSignOut}>
                        <ListItemIcon className='item_icon'>
                            <LogoutIcon sx={{color: 'white'}}/>
                        </ListItemIcon>
                        <ListItemText primary="Sair" className='text_menu'/>
                    </Button>
                </ListItem>
            </List>
        </Box>
    );

  return (
    <>
        <CssBaseline />
        <AppBar position="relative">
          <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu" onClick={toggleDrawer(true)}>
            <MenuIcon />
          </IconButton>
            <Box className='moviePlay'>
                <Typography variant="h6" color="inherit" noWrap className='moviePlay_text'>
                    MoviePlay
                </Typography>
            </Box>
  
            <Box style={{ display: 'flex', alignItems: 'center', marginLeft: 'auto' }}>
                <AccountCircleIcon fontSize='large'/>
            </Box>
          </Toolbar>
        </AppBar>
        <Drawer anchor="left" open={isDrawerOpen} onClose={toggleDrawer(false)}>
            {list}
        </Drawer>

        <main>
            <Box style={{ backgroundColor: 'black', minHeight: '100vh', padding: '20px' }}>
                <Typography className='category' style={{ marginTop: '20px'}}>
                    On The Rise
                </Typography>
                <Card sx={{ maxWidth: 150, mt: 5 }}>
                    <CardMedia
                        component="img"
                        height="200"
                        image="https://media.fstatic.com/un-0RsK54_7_bab5Q8ELukivy2Q=/322x478/smart/filters:format(webp)/media/movies/covers/2022/02/FK9jOgqaQAAaBDc.jpg"
                        alt="Imagem do Card"
                    />
                    <CardContent>
                        <Typography gutterBottom component="div" className='title'>
                            Surprise Suitor
                        </Typography>
                        <Button type="submit" sx={{ mt: 1}} variant="outlined" size="small">
                            Comprar
                        </Button>
                    </CardContent>
                </Card>   
            </Box>
        </main>
    </> 
  )
}

export default Home
